import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function Plastic() {
    const [product, setproduct] = useState([]);

    useEffect(() => {
        let apiUrl = 'http://localhost:4000/plastic'
        fetch(apiUrl, { method: "GET" })
            .then(response => response.json())
            .then(data => setproduct(data))
            .catch(err => console.error("Error fetching data: ", err));
    }, []);


    const formatePro = product.map(item => {
        return (
            <div className="col-3 p-2 me-4">
            <div className="card" style={{ width: '18rem' }}>
                <div className="divImage">
                <img src={item.image} class="card-img-top mainImg" alt="..." />
                </div>
                <div className="card-body">
                    <h2 className="id">
                        id:
                        {item.id}
                    </h2>
                    <h5 className="card-title id">
                        name
                        {item.name}</h5>
                    <h5 className="id">
                        Price:â‚¹
                        {item.price}
                    </h5>

                </div>
                    <Link to={'/ReadMore'} class="btn btn-outline-primary m-2" >Read More...</Link>
                    <Link to={'/ReadMore'} class="btn btn-outline-warning m-2" >E</Link>
                    <Link to={'/ReadMore'} class="btn btn-outline-danger m-2" >Read More...</Link>

            </div>
            </div>

        )
    })


    return (
        <>
            <div className="container">
                <div className="row">
                {formatePro}
                    
                    
                    </div>
                   
                </div>

        </>
    );
}

export default Plastic;
